informacaoComplementar:
Identificou-se que nas determinações do Acórdão 1913/2024-TCU-Plenário e do Acórdão 1648/2024-TCU-Plenário, o controle externo exige reforço da governança, integridade, transparência ativa e sustentabilidade institucional nos Conselhos Profissionais. Nessa linha, o Estudo Técnico Preliminar (ETP) evidenciou a necessidade de elevar o nível de maturidade em governança, integridade, sustentabilidade e gestão estratégica do Confea, conforme apontado pelo iESGo 2024, que evidenciou índices baixos ou inexpressivos em governança de pessoas, TI, riscos, sustentabilidade ambiental e social.

Dessa forma, a proposta de contratação contempla as seguintes frentes de trabalho articuladas: elaboração e execução de programas estruturados de governança e gestão, integridade e sustentabilidade, compreendendo, entre outros:

- fortalecimento da governança e da accountability;

- consolidação da integridade organizacional e da cultura de riscos;

- implementação de indicadores de desempenho e monitoramento estratégico;

- integração das práticas de sustentabilidade ambiental e social (ESG);

- desenvolvimento de competências gerenciais e disseminação de boas práticas de gestão pública.

Cada frente será executada de forma coordenada, promovendo sinergia entre os resultados e permitindo avanços consistentes na maturidade organizacional do CONFEA, conforme padrões de governança já reconhecidos pelo modelo iESGo do TCU.
